import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
  },
  companyName: {
    marginTop: "5%",
    alignSelf: "center",
    color: "#121212",
    fontSize: 20,
  },
  shareCardData: {
    padding: 10,
    height: 40,
    width: "100%",
    paddingTop: "2%",
    paddingLeft: "10%",
    paddingRight: "10%",
    marginBottom: "2%",
    marginTop: "2%",
    backgroundColor: "#FFFFFF",
  },
  alanyticView: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  itemCardText: {
    color: "#374046",
    fontStyle: "italic",
  },
  chartTitle: {
    color: "#374046",
    fontStyle: "italic",
    marginLeft: "10%",
  },
});
